import React from "react";
import "./styles.css";

export default function App() {
  return (
    <article className="article">
      <h2 className="article__title">I choose not to choose</h2>
      <label htmlFor="attributes">
        <input type="text" name="" id="attributes" />
      </label>
      <a
        href="https://en.wikipedia.org/wiki/List_of_vice_presidents_of_Argentina#:~:text=Current%20events-,Random%20article,-About%20Wikipedia"
        className="article__link"
      >
        Here is the link
      </a>
    </article>
  );
}
